import React from 'react'
import {Link} from 'react-router-dom';
import queryString from 'querystring';
 export default class Header extends React.Component{


  constructor(props){
    super(props);
    this.state={
      email: queryString.parse( this.props.location.search ).email,
    }
  }


  render(){
    return(
        <div>
        <div className="header">
        <div className="header_lft">
          <div className="logo"><a ><img src="images/logo.png" /></a></div>
          <div className="navigatn">
            <ul>
              <li><a  className="active" id="home" ><Link to={`/home?email=${this.state.email}`}>Home</Link></a></li>
              <li><a > E-Coupons </a></li>
              <li><a >E-Brands </a></li>
              <li><a > Resuse Market </a></li>
              <li><a > Lost and Found</a></li>
            </ul>
          </div>
        </div>
        <div className="header_rgt">
          <div className="flag_div"><img src="images/flag.png" /></div>
          <input type="text" placeholder="Search" className="txt_box" />
          <div className="msg_box"><a ><span className="msg_count">100</span></a></div>
          <div className="info_div">
            <div className="image_div"> <img src="images/pic.png" /> </div>
            <div className="info_div1"    id="timeline"   ><Link to={`/timeline?email=${this.state.email}`}>Me</Link></div>
          </div>
        </div>
      </div>
      </div>

      );

  }




}
